      "link": "https://www.hangyo.com/mobile/article.html?no=97179",
      "previewDesc": "“아이들을 보면 상대의 말을 오해해서 주먹다짐까지 이어지기도 해요. 말하는 사람의 의도를 듣는 사람이 전혀 다르게 해석한 거죠. 말을 전달하는 과정에서 한 번 더 생각하면 사소한 오해나 다툼이 없지 않을까요?” ‘2022 학생 언어문화개선 공모전’에서 캘리그래피 부문 대상을 받은 임종민 충남 서정초 교사는 바른 언어 사용의 중요성을 누구보다 절감한다고 했다. 학교에서 은어나 지나치게 줄인 말을 사용하는 학생들이 적지 않아서 그 뜻을 이해하기 어려운 적이 잦았다. 시대를 따라가지 못한다는 느낌도 받았다. 임 교사는 “아이들을 가르치는 나부터 바르게 써야겠다고 마음먹었다”고 했다. “선생님이 친근감을 표현하려고 유머를 입힌 언어를 사용했는데, 학생은 기분이 상하는 경우를 봤어요. 오랜 시간을 함께 보내는 사이인 만큼 학생도, 선생님도 함께 노력해야겠구나, 생각했어요. 집에서도 마찬가지예요. 어느 한쪽만 변화해서는 언어 문제를 개선할 수 없어요. 다 같이 해야죠. 학교에서 가정에서 모두 다 같이 노력해야 극복할 수 있어요.” 임 교사는 ‘우리 함께 높여볼까요? 언어의 품격’을 캘리그래피로 표현했다. 전문가의 작품 못지않게 완성도가 높아 눈길을 끌었다. 그는 “교육자료를 검색하다가 우연히 발견한 공모전 공고를 보고 처음 참가했다”고 귀띔했다. 임 교사는 10여 년 전, 취미로 캘리그래피에 입문했고, 그 매력에 빠져 전문가 과정까지 밟았다. 차근하게 쌓은 실력은 교직생활에도 도움이 됐다. 각종 행사가 열릴 때는 재능기부를 하고, 캘리그래피를 배우고 싶어 하는 동료를 대상으로 연수도 진행했다. 창의적 체험활동 시간에는 학생들과 부채 만들기, 캠페인 피켓 만들기 등을 지도했다. 그는 “앞으로 미술 시간이나 국어 시간에 캘리그래피를 활용한 수업도 해보고 싶다”고 전했다. 이모티콘 부문 대상은 경북 구미인덕초 5학년 정세은 양이 차지했다. ‘귀여운 요정’ 이모티콘은 감사해요, 괜찮아요, 사랑해요, 힘내요 등 우리가 일상에서 사용하는 말과 함께 요정 캐릭터의 표정과 행동을 접목했다. 애니메이션 효과를 더해 움직이는 이모티콘으로 완성했다. 세은 학생의 꿈은 이모티콘 작가다. 어려서부터 그림 그리기에 재미를 붙였고, 유튜브에서 이모티콘 만드는 과정을 접한 후 꿈을 정했다. 어머니 이정인 씨는 “아이의 장래희망을 알고 있던 선생님이 공모전 소식을 알려주셔서 친구들과 함께 참가했다”고 했다. 세은 학생은 태블릿 PC로 작업했다. 평소 스케치 해뒀던 캐릭터 가운데 주변에서 가장 반응이 좋았던 요정 캐릭터를 출품하기로 마음먹었다. 움직이는 이모티콘을 만들기 위해서 그림 한 컷, 한 컷을 그리고 이어붙였다. 세은 학생은 “이모티콘의 움직임이 딱딱해서 여러 번 다시 그렸다”며 웃었다. “대상을 받아서 신기했어요. 가족들한테 국민 투표에 참여해달라고 부탁했는데, 고마웠어요. 지금부터 여러 가지 이모티콘을 만들어보려고요. 카카오톡에 이모티콘 등록을 목표로 도전해보려고 해요.” 교수·학습자료 부문 대상은 ‘On(溫)기 넘치는 우리의 온라인 언어 세우기’를 출품한 허광수·이민재·차수미 대전원앙초 교사에게 돌아갔다. 온라인 채팅과 메타버스의 상황으로 구분해 2차시 수업으로 구성했다. 이들은 “학생들의 온라인 언어생활 실태를 알아보고 올바르지 못한 부분이 있다면 학생들 스스로 어떻게 하면 올바른 언어 습관을 형성할 수 있을지 생각해볼 수 있게 기획했다”면서 “특히 익명성이 보장된 사이버 공간에서 존중을 바탕으로 의사소통하고 갈등을 해결할 방법을 실천하는 데 초점을 맞췄다”고 전했다. 공모전 수상작은 학생 언어문화개선 홈페이지(goodword.kr)에서 확인할 수 있다.",
